import * as React from "react";
import RabbitBWhiteBorder from './RabbitBWhiteBorder';

interface IRabbitBProps {
  handleMouseEnter: () => void;
  handleMouseLeave: () => void;
}

interface IRabbitBState {
  isHover: boolean;
}

class RabbitB extends React.Component<IRabbitBProps, IRabbitBState> {
  constructor(props: IRabbitBProps) {
    super(props);
    this.state = {
      isHover: false
    };
    this.handleMouseEnter = this.handleMouseEnter.bind(this);
    this.handleMouseLeave = this.handleMouseLeave.bind(this);
  }

  public render() {
    return (
      <svg
        className="rabbitB"
        version="1.1"
        xmlns="http://www.w3.org/2000/svg"
        x="0px"
        y="0px"
        viewBox="0 0 231.11 313.25"
        onMouseEnter={this.handleMouseEnter}
        onMouseLeave={this.handleMouseLeave}
      >
        {this.state.isHover ? <RabbitBWhiteBorder /> : null}
        <image width="220" height="299" transform="translate(6.69 9.1) scale(0.99)" xlinkHref="data:image/png;base64,"/>
      </svg>
    );
  }

  private handleMouseEnter() {
    this.setState({
      isHover: true
    });

    this.props.handleMouseEnter();
  }

  private handleMouseLeave() {
    this.setState({
      isHover: false
    });

    this.props.handleMouseLeave();
  }
}

export default RabbitB;
